import React from 'react';
import {BrowserRouter, Route  , Routes} from 'react-router-dom' ;

import Main from './Main.js';
import Login from './Login.js';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes >
        <Route path='/' element = {<Login/>} />
        <Route path='/Nav'  element = {<Main />} />
      </Routes>
      </BrowserRouter>
      
    </div>
  );
}

export default App;
